import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import Logo from './Logo';
import '../Styles/header.css';

import { Navbar, Container, Nav, Button } from 'react-bootstrap';

function Header() {
    return (
        <BrowserRouter>
            <Navbar collapseOnSelect variant="dark" expand="lg" sticky="top" className="border-bottom">
                <Container>
                    <Navbar.Brand href="/">
                        <Logo />
                    </Navbar.Brand>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav className="me-auto">
                            <Nav.Link href="/partner">Partners</Nav.Link>
                            <Nav.Link href="/opportunity">Opportunity</Nav.Link>
                            <Nav.Link href="#features">What's Happening</Nav.Link>
                            <Nav.Link href="#features">Spice-IN</Nav.Link>
                            <Nav.Link href="#pricing">About Us</Nav.Link>

                        </Nav>
                        <Nav>
                            <Button variant="outline-primary" className="m-1" href="/SignUp">Sign Up</Button>
                            <Button variant="outline-success" className="m-1" href="/employer" >For Employer</Button>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>


        </BrowserRouter>
    )
}

export default Header;
